import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import $ from 'jquery';
import Popper from 'popper.js';
import 'bootstrap/dist/js/bootstrap.bundle.min';
import {Link} from 'react-router-dom';
import './navigation.css';

const Navigation = ({ onRouteChange, text }) => {
    return (

        <nav className="navbar navbar-expand-lg navbar-dark bg-primary">
        <Link className="navbar-brand" to="/root">QR App</Link>

        <div className="collapse navbar-collapse" id="navbarSupportedContent">
            <ul className="navbar-nav mr-auto">
                <li className="nav-item active navbar-right">
                    {
                        text === 'Sign In' ? <a className="nav-link" href="http://localhost:5000/signin">{text}</a> :
                            <a className='nav-link' href="http://localhost:5000/plantstats"></a>
                    }
                </li>
            </ul>
        </div>
    </nav>

);

};

export default Navigation;
